require 'csv'
sheet_array = ['Sheet1.csv', 'Sheet2.csv', 'Sheet3.csv', 'Sheet4.csv', 'Sheet5.csv', 'Sheet6.csv', 'Sheet7.csv', 'Sheet8.csv', 'Sheet9.csv', 'Sheet10.csv']
sheet_array.each do |sheet|
	csv_text = File.read(Rails.root.join('lib','seeds', sheet))
	csv = CSV.parse(csv_text, :headers => true, :encoding => 'ISO-8859-1')
	csv.each do |row|
		if row['title'] != nil && row['author'] != nil
			b = Book.find_by(title: row['title'].downcase)
		end

		if b == nil && row['title'] != nil && row['author'] != nil

			Book.create!(:title => row['title'].downcase, :author => row['author'].downcase, :rank => row['rank'].to_i)
		else
			b.rank += 1
			b.save
		end
	end
end

portnoys = Book.find(301)
portnoys.rank += 2
portnoys.save
Book.find(68).destroy

midnights = Book.find(304)
midnights.rank += 3
midnights.save
Book.find(77).destroy

